import React, { useState } from 'react'
import Edit from './Edit'

export default function Name() {
    const [isSidebarOpen, setIsSidebarOpen] = useState(false)
    const [username, setUsername] = useState('')

    const toggleSidebar = () => {
        setIsSidebarOpen(!isSidebarOpen)
    }

    const fetchUsernameData = async () => {
        try {
            const response = await fetch('http://localhost:5000/users/username')
            if (response.ok) {
                const data = await response.json()
                setUsername(data.username) // Assuming your API returns an object with the username
            } else {
                console.error('Failed to fetch username data!!')
            }
        } catch (error) {
            console.error('Error fetching username data:', error)
        }
    }

    return (
        <div className={`the-container ${isSidebarOpen ? 'disable-the-container' : ''}`}>
            <div className={`edit-sidebar ${isSidebarOpen ? 'open' : ''}`}>
                <Edit onClose={toggleSidebar} />
            </div>
            <div className='name-container'>
                <div className='name'>
                    <div>
                        <div className='username'>{username}</div>
                        <div className='username'>1234567890</div>
                        <div className='username'>dav2005@gmail.com</div>
                    </div>
                </div>
                <div className='edit'>
                    <button className='edit-profile' onClick={toggleSidebar}>
                        EDIT PROFILE
                    </button>
                </div>
            </div>
        </div>
    )
}
